import logo from './assets/mercedes.png';
import './App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

function App() {
  return (
    <div className="site">
      <div className="sidebar">
        <div>
        <FontAwesomeIcon icon="fa-solid fa-user" />
          <p>Login</p></div>
      </div>
      <div className="header">
        <p>Mercedes-Benz Metaverse</p>
        <p>Asset and Contract Administration</p>
      </div>
      <img src={logo} className="logo" alt="logo" />
      <div className="middle">
        <button className="button"><span>Dashboard</span></button>
        <button className="button"><span>Assets</span></button>
        <button className="button"><span>Provider Portal</span></button>
        <button className="button"><span>Consumer Portal</span></button>
      </div>
    </div>
  );
}

export default App;
